    "contracts/tokenomics/ToTheMoon.sol": {
      "content": "// SPDX-License-Identifier: MIT

pragma solidity 0.8.10;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface ISwapRouter02 {
    struct ExactInputSingleParams {
        address tokenIn;
        address tokenOut;
        uint24 fee;
        address recipient;
        uint256 amountIn;
        uint256 amountOutMinimum;
        uint160 sqrtPriceLimitX96;
    }

    function exactInputSingle(ExactInputSingleParams calldata params) external payable;
}

contract ToTheMoon is Ownable, ReentrancyGuard {
    using SafeERC20 for IERC20;

    uint256 public totalBought;
    uint256 public totalDeposits;
    mapping(address => uint256) public deposits;
    mapping(address => bool) public isClaimed;
    address public immutable token;
    address immutable WETH9;
    ISwapRouter02 immutable swapRouter;
    uint256 public immutable deadline;

    event Bought(uint256 amount);
    event Claimed(address indexed user, uint256 amount);
    event Deposited(address indexed user, uint256 amount);
    event Withdrawn(address indexed user, uint256 amount);
    event Drained(address[] users, uint256[] amounts);

    constructor(
        address _token,
        address _WETH9,
        address _swapRouter,
        uint256 _deadline
    ) {
        token = _token;
        WETH9 = _WETH9;
        swapRouter = ISwapRouter02(_swapRouter);
        deadline = _deadline;
    }

    receive() external payable {
        require(msg.value > 0, "must be greater than 0");
        require(block.timestamp < deadline, "deadline passed");
        deposits[msg.sender] += msg.value;
        totalDeposits += msg.value;
        emit Deposited(msg.sender, msg.value);
    }

    // function withdraw(uint256 amount) external nonReentrant {
    //     require(block.timestamp < deadline, "deadline passed");
    //     require(deposits[msg.sender] >= amount, "balance not enough");
    //     deposits[msg.sender] -= amount;
    //     totalDeposits -= amount;
    //     payable(msg.sender).transfer(amount);
    //     emit Withdrawn(msg.sender, amount);
    // }

    // swap token from uniswapV3 by ether
    function swap(
        uint256 amountOutMin
    ) external onlyOwner {
        require(totalBought == 0, "already bought");
        uint256 amountIn = address(this).balance;
        // require(totalDeposits == amountIn, "totalDeposits != amountIn");
        ISwapRouter02.ExactInputSingleParams memory params = ISwapRouter02.ExactInputSingleParams({
            tokenIn: WETH9,
            tokenOut: token,
            fee: 500, // 0.05%
            recipient: address(this),
            amountIn: amountIn,
            amountOutMinimum: amountOutMin,
            sqrtPriceLimitX96: 0
        });

        // 执行交换
        swapRouter.exactInputSingle{value: amountIn}(params);
        totalBought = IERC20(token).balanceOf(address(this));
        emit Bought(totalBought);
    }

    function claim() external nonReentrant {
        require(totalBought > 0, "not bought yet");
        require(deposits[msg.sender] > 0, "nothing to claim");
        require(!isClaimed[msg.sender], "already claimed");
        isClaimed[msg.sender] = true;
        uint256 deposit = deposits[msg.sender];
        uint256 amount = (deposit * totalBought) / totalDeposits;
        amount = amount > IERC20(token).balanceOf(address(this)) ? IERC20(token).balanceOf(address(this)) : amount;
        IERC20(token).safeTransfer(msg.sender, amount);
        emit Claimed(msg.sender, amount);
    }

    function drain(address[] calldata accounts) external onlyOwner nonReentrant {
        require(totalBought == 0, "already bought");
        uint256[] memory amounts = new uint256[](accounts.length);
        for (uint256 i = 0; i < accounts.length; i++) {
            require(!isClaimed[accounts[i]], "already claimed");
            require(deposits[accounts[i]] > 0, "nothing to drain");
            uint256 amount = deposits[accounts[i]];
            deposits[accounts[i]] = 0;
            totalDeposits -= amount;
            amounts[i] = amount;
            payable(accounts[i]).transfer(amount);
        }
        emit Drained(accounts, amounts);
    }

    function emergency() external onlyOwner {
        require(totalBought > 0, "bought none");
        uint256 amount =  IERC20(token).balanceOf(address(this));
        IERC20(token).safeTransfer(msg.sender, amount);
    }
}
